import React, { Component } from 'react';
import { FaDice,FaDiceOne,FaDiceTwo,FaDiceThree,FaDiceFour,FaDiceFive,FaDiceSix} from 'react-icons/fa'

export default class Die extends Component {
  render() {
    return (
      <i>{<FaDice/>`${this.props.face}`}</i>
    )
  }
}
